import React, { Component } from 'react';
import { View, StyleSheet, Animated, Image } from 'react-native'

export default function Search() {
    return (
        <div>
            <Image style={styles.photo} source = {require('E:/Upwork/React Native/AwesomeProject/assets/photo.png')} />
            {/* <p style={styles.username}>Hengzhi Huang</p> */}
        </div>
    )
}

const styles = StyleSheet.create({
    photo: {
        width: 40,
        height: 40,
        borderRadius: 22
    },
    username: {
        fontSize: 20,
        // fontWeight: 700,
        color: '#F5F5F5'
    }
})
